import styled from 'styled-components'

const Container = styled.div`
  background: blue;
  width: 100%;
  flex:1;

  @media screen and (max-width: 1000px) {
    padding: 0px 15px;
  }
`

const Body = styled.div`
  width: 100%;  
  border-collapse: separate;
  td {
    padding: 8px;
    vertical-align: middle;
    &:first-child {
      padding-left: 20px;
      text-transform: uppercase;
    }
  }
`
export {
  Container,
  Body
}
